SET NAMES utf8;
SET time_zone = '+00:00';
SET foreign_key_checks = 0;
SET sql_mode = 'NO_AUTO_VALUE_ON_ZERO';

SET NAMES utf8mb4;


CREATE DATABASE IF NOT EXISTS cccc;

USE cccc;

DROP TABLE IF EXISTS meal_plan;
CREATE TABLE meal_plan
(
    household_id  INT    NOT NULL,
    breakfast1    INT    NULL,
    breakfast2    INT    NULL,
    breakfast3    INT    NULL,
    dinner1       INT    NULL,
    dinner2       INT    NULL,
    dinner3       INT    NULL,
    lunch1        INT    NULL,
    lunch2        INT    NULL,
    lunch3        INT    NULL,
    breakfast_fee DOUBLE NULL,
    dinner_fee    DOUBLE NULL,
    lunch_fee     DOUBLE NULL,
    CONSTRAINT pk_mealplan PRIMARY KEY (household_id)
);

DROP TABLE IF EXISTS meal_tracker;
CREATE TABLE meal_tracker
(
    id            INT          NOT NULL AUTO_INCREMENT,
    last_modified datetime     NULL,
    meal_id       INT          NULL,
    person_id     INT          NULL,
    register_id   INT          NULL,
    household_id  INT          NULL,
    remark        VARCHAR(255) NULL,
    CONSTRAINT pk_mealtracker PRIMARY KEY (id)
);

DROP TABLE IF EXISTS register_profile;
CREATE TABLE register_profile
(
    profile_id  INT NOT NULL,
    register_id INT NULL,
    CONSTRAINT pk_registerprofile PRIMARY KEY (profile_id)
);

DROP TABLE IF EXISTS `church`;
CREATE TABLE `church` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `acronym` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `name_cn` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `name_en` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `city` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `state` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `zipcode` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `region` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `website` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `admin_id` int unsigned DEFAULT NULL COMMENT 'admin''s user id',
  PRIMARY KEY (`id`),
  KEY `admin_id` (`admin_id`),
  CONSTRAINT `church_ibfk_2` FOREIGN KEY (`admin_id`) REFERENCES `user` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `event`;
CREATE TABLE `event` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `name_cn` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `name_en` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_cn` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_en` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `stripe_descriptor` char(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'statement_descriptor in stripe',
  `flyer` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `link` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `location` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `city` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `state` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `zipcode` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `deadline` date NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date NOT NULL,
  `capacity` smallint unsigned NOT NULL,
  `option` smallint unsigned NOT NULL COMMENT 'number of options for this event',
  `notify_email` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `contact_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `closed_message` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'message to show when event is closed for registration',
  `status` tinyint unsigned NOT NULL DEFAULT '1' COMMENT '0=archived;1=closed;2=open',
  `online_payment` tinyint unsigned NOT NULL COMMENT '0=no online payment;1=take online payment',
  `church_sponsor` tinyint unsigned NOT NULL COMMENT '0=no church sponsor;1=church sponsor available, do not pay online if need church sponsor',
  `allow_guest` tinyint unsigned NOT NULL COMMENT '0=no guest registration;1=open for guest registration',
  `has_group` tinyint unsigned NOT NULL COMMENT '0=no small group; 1=has small group',
  `use_zoom` tinyint unsigned NOT NULL COMMENT '0=do not use zoom; 1=use zoom',
  `group_leader_option_id` int unsigned DEFAULT NULL COMMENT 'option id for small group volunteer question',
  `group_leader_option_value` tinyint unsigned DEFAULT NULL COMMENT 'option value for small group volunteer question',
  `join_email_date` date DEFAULT NULL COMMENT 'estimated date to send join email before event starts',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `group_leader_option_id` (`group_leader_option_id`),
  CONSTRAINT `event_ibfk_2` FOREIGN KEY (`group_leader_option_id`) REFERENCES `option` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `meal`;
CREATE TABLE `meal` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `event_id` int unsigned NOT NULL,
  `date` date NOT NULL,
  `start_time` time NOT NULL,
  `end_time` time NOT NULL,
  `deadline` datetime NOT NULL,
  `type` tinyint unsigned NOT NULL COMMENT '0=Other;1=Breakfast;2=Lunch;3=Dinner;4=Snack',
  `location` tinyint unsigned NOT NULL COMMENT '0=Other;1=CCCC;2=GRACE',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `price` decimal(13,4) unsigned NOT NULL COMMENT 'price in dollar',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `event_id` (`event_id`),
  CONSTRAINT `meal_ibfk_2` FOREIGN KEY (`event_id`) REFERENCES `event` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `option`;
CREATE TABLE `option` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `event_id` int unsigned NOT NULL,
  `type` tinyint unsigned NOT NULL COMMENT '1=section;2=workshop;3=volunteer;4=status;5=note',
  `order` tinyint unsigned NOT NULL,
  `is_online` tinyint unsigned NOT NULL,
  `from_age` tinyint unsigned NOT NULL,
  `to_age` tinyint unsigned NOT NULL,
  `name_en` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `name_cn` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_en` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_cn` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `location` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `start_time` datetime NOT NULL,
  `end_time` datetime NOT NULL,
  `deadline` datetime NOT NULL,
  `required_option_id` int unsigned DEFAULT NULL,
  `early_price` decimal(13,4) unsigned NOT NULL,
  `early_group_price` decimal(13,4) unsigned NOT NULL,
  `normal_price` decimal(13,4) unsigned NOT NULL,
  `normal_group_price` decimal(13,4) unsigned NOT NULL,
  `late_price` decimal(13,4) unsigned NOT NULL,
  `early_price_end` datetime NOT NULL,
  `late_price_start` datetime NOT NULL,
  `value` json NOT NULL,
  PRIMARY KEY (`id`),
  KEY `event_id` (`event_id`),
  CONSTRAINT `option_ibfk_2` FOREIGN KEY (`event_id`) REFERENCES `event` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `payment`;
CREATE TABLE `payment` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `register_id` int unsigned DEFAULT NULL,
  `coupon_id` int unsigned DEFAULT NULL,
  `event_id` int unsigned DEFAULT NULL,
  `user_id` int unsigned NOT NULL COMMENT 'payer''s user id',
  `type` tinyint unsigned NOT NULL COMMENT '1=Online;2=Onsite;3=Check;4=Cash;5=Coupon;6=Other',
  `paid_on` datetime NOT NULL,
  `stripe_charge_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `register_fee` decimal(13,4) unsigned NOT NULL,
  `register_discount` decimal(13,4) unsigned NOT NULL,
  `meal_fee` decimal(13,4) unsigned NOT NULL,
  `meal_discount` decimal(13,4) unsigned NOT NULL,
  `donation` decimal(13,4) unsigned NOT NULL,
  `material_fee` decimal(13,4) unsigned NOT NULL,
  `material_discount` decimal(13,4) unsigned NOT NULL,
  `other_fee` decimal(13,4) unsigned NOT NULL,
  `other_discount` decimal(13,4) unsigned NOT NULL,
  `total` decimal(13,4) GENERATED ALWAYS AS (((((`register_fee` + `meal_fee`) + `donation`) + `material_fee`) + `other_fee`)) VIRTUAL,
  `discount` decimal(13,4) GENERATED ALWAYS AS ((((`register_discount` + `meal_discount`) + `material_discount`) + `other_discount`)) VIRTUAL,
  `net` decimal(13,4) GENERATED ALWAYS AS ((`total` - `discount`)) VIRTUAL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `register_id` (`register_id`),
  KEY `coupon_id` (`coupon_id`),
  KEY `event_id` (`event_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `payment_ibfk_10` FOREIGN KEY (`event_id`) REFERENCES `event` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `payment_ibfk_12` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `payment_ibfk_7` FOREIGN KEY (`register_id`) REFERENCES `register` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `payment_ibfk_8` FOREIGN KEY (`coupon_id`) REFERENCES `coupon` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `profile`;
CREATE TABLE `profile` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_id` int unsigned DEFAULT NULL,
  `household_id` int unsigned DEFAULT NULL,
  `added_by` int unsigned DEFAULT NULL,
  `cn_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `first_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `last_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `sex` enum('M','F') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'M=Male, F=Female',
  `birth` year NOT NULL,
  `phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `wechat` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `address2` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `city` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `state` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `country` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `zipcode` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `believe` year DEFAULT NULL,
  `church_id` int unsigned DEFAULT NULL,
  `serve` tinyint unsigned DEFAULT NULL COMMENT '1=NA;2=Missionary;3=Pastor;4=Seminary;5=Nonprofit;6=Campus;7=Deacon;8=Fellowship;9=Other',
  `status` tinyint unsigned DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `household_id` (`household_id`),
  KEY `user_id` (`user_id`),
  KEY `church_id` (`church_id`),
  KEY `added_by` (`added_by`),
  CONSTRAINT `profile_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `profile_ibfk_3` FOREIGN KEY (`church_id`) REFERENCES `church` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `profile_ibfk_4` FOREIGN KEY (`added_by`) REFERENCES `user` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `refund`;
CREATE TABLE `refund` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `payment_id` int unsigned NOT NULL,
  `refund_on` datetime NOT NULL,
  `refund_by` int unsigned DEFAULT NULL,
  `stripe_refund_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `register_refund` decimal(13,4) unsigned NOT NULL,
  `meal_refund` decimal(13,4) unsigned NOT NULL,
  `donation_refund` decimal(13,4) unsigned NOT NULL,
  `material_refund` decimal(13,4) unsigned NOT NULL,
  `other_refund` decimal(13,4) unsigned NOT NULL,
  `total` decimal(13,4) GENERATED ALWAYS AS (((((`register_refund` + `meal_refund`) + `donation_refund`) + `material_refund`) + `other_refund`)) VIRTUAL,
  PRIMARY KEY (`id`),
  KEY `payment_id` (`payment_id`),
  KEY `refund_by` (`refund_by`),
  CONSTRAINT `refund_ibfk_2` FOREIGN KEY (`payment_id`) REFERENCES `payment` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `refund_ibfk_3` FOREIGN KEY (`refund_by`) REFERENCES `user` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `register`;
CREATE TABLE `register` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `household_id` int unsigned NOT NULL,
  `event_id` int unsigned NOT NULL,
  `profile_id` json NOT NULL COMMENT 'participant''s profile id(s), in JSON format',
  `created_on` datetime NOT NULL,
  `last_update` timestamp NOT NULL ON UPDATE CURRENT_TIMESTAMP,
  `status` tinyint NOT NULL COMMENT '0=canceled;1=unpaid;2=pending payment(group);3=paid;minus=incomplete in option X',
  `price_model` tinyint unsigned NOT NULL COMMENT '0=default, based on current time;1=early bird;2=early bird group;3=normal;4=normal group;5=late price',
  `adult` tinyint unsigned NOT NULL,
  `meal` tinyint unsigned DEFAULT NULL,
  `stripe_customer_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `checkin_time` datetime DEFAULT NULL,
  `total_people` tinyint unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `user_id` (`household_id`),
  KEY `event_id` (`event_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `register_meal`;
CREATE TABLE `register_meal` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `register_id` int unsigned NOT NULL,
  `meal_id` int unsigned NOT NULL,
  `qty` tinyint unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `meal_id` (`meal_id`),
  KEY `register_id` (`register_id`),
  CONSTRAINT `register_meal_ibfk_4` FOREIGN KEY (`meal_id`) REFERENCES `meal` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `register_meal_ibfk_5` FOREIGN KEY (`register_id`) REFERENCES `register` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `register_option`;
CREATE TABLE `register_option` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `register_id` int unsigned DEFAULT NULL,
  `profile_id` int unsigned NOT NULL,
  `option_id` int unsigned NOT NULL,
  `option_value` tinyint unsigned DEFAULT NULL,
  `option_note` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `profile_id` (`profile_id`),
  KEY `option_id` (`option_id`),
  KEY `register_id` (`register_id`),
  CONSTRAINT `register_option_ibfk_3` FOREIGN KEY (`profile_id`) REFERENCES `profile` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `register_option_ibfk_4` FOREIGN KEY (`option_id`) REFERENCES `option` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `register_option_ibfk_6` FOREIGN KEY (`register_id`) REFERENCES `register` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `join_time` datetime NOT NULL,
  `status` tinyint unsigned NOT NULL COMMENT '0=active;1=need verify email;2=force change password;3=disabled',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


